t = min - pad;\n            range.end = max + pad;\n        } else console.error('backtesting: scale range error:', min, max, range);\n    };\n}\n\nclearTimeout(window._bt_autoscale_timeout);\n\nwindow._bt_autoscale_timeout = setTimeout(function () {\n    /**\n     * @variable cb_obj `fig_ohlc.x_range`.\n     * @variable source `ColumnDataSource`\n     * @variable ohlc_range `fig_ohlc.y_range`.\n     * @variable volume_range `fig_volume.y_range`.\n     */\n    \"use strict\";\n\n    let i = Math.max(Math.floor(cb_obj.start), 0),\n        j = Math.min(Math.ceil(cb_obj.end), source.data['ohlc_high'].length);\n\n    let max = Math.max.apply(null, source.data['ohlc_high'].slice(i, j)),\n        min = Math.min.apply(null, source.data['ohlc_low'].slice(i, j));\n    _bt_scale_range(ohlc_range, min, max, true);\n\n    if (volume_range) {\n        max = Math.max.apply(null, source.data['Volume'].slice(i, j));\n        _bt_scale_range(volume_range, 0, max * 1.03, false);\n    }\n\n}, 50);\n"},"id":"2874249","type":"CustomJS"},{"attributes":{"label":{"value":"Trades (1242)"},"renderers":[{"id":"2874148"}]},"id":"2874165","type":"LegendItem"},{"attributes":{"line_color":"#1f77b4","line_width":1.3,"x":{"field":"index"},"y":{"field":"aberration(H,L,C)_0_4"}},"id":"2874228","type":"Line"},{"attributes":{"coordinates":null,"data_source":{"id":"2873870"},"glyph":{"id":"2874188"},"group":null,"hover_glyph":null,"muted_glyph":{"id":"2874190"},"nonselection_glyph":{"id":"2874189"},"view":{"id":"2874192"}},"id":"2874191","type":"GlyphRenderer"},{"attributes":{},"id":"2873936","type":"AllLabels"},{"attributes":{},"id":"2873859","type":"ResetTool"},{"attributes":{"line_alpha":{"value":0.2},"line_color":{"field":"returns_positive","transform":{"id":"2873874"}},"line_dash":{"value":"dotted"},"line_width":{"value":8},"xs":{"field":"position_lines_xs"},"ys":{"field":"position_lines_ys"}},"id":"2874147","type":"MultiLine"},{"attributes":{"line_alpha":0.1,"line_color":"#1f77b4","line_width":1.3
